import { Container } from "@chakra-ui/react";
import React from "react";
import Header from "@/components/Header";

const Layout = ({ children }) => {
  return (
    <>
      <Header />
      <Container w="100%" bg="tomato">
        <Container
          centerContent
          w="100%"
          bg="brand.white"
          h="calc(100vh - 60px)"
        >
          {children}
        </Container>
      </Container>
    </>
  );
};

export default Layout;
